import React from "react";
import "./Meme.css"

function Meme(props) {
    console.log("500" <"600");
    const scaleDown = {width: "50%", height: "auto"};
    const normalSize = {width: props.data.width+"px", height:  props.data.height+"px"};
    return(
        <div id = "memeWrapper">
            <img 
                style = {props.data.width > 500 ? scaleDown : scaleDown}
                alt = "Dank Meme"
                src = {props.data.img}
            />

            <h2 className = "memeTopText"> {props.topText} </h2>

            <h2 className = "memeBottomText"> {props.bottomText} </h2>
        </div>
    );
}

export default Meme;
